import React from 'react';

import './messageLine.css'

export default function MessageLine(props) {
    return(
        <div id='messageContainer'>
            {props.tipeMessage === 'error' && <img src={require('../../assets/incons/icon-error.svg')} alt='icon-error' id='messageIcon'/>}
            <label id='messageTxt'>{props.message}</label>
        </div>
    )
}
